import "./LoginForm.css";
import Panel from "components/Panel/Panel";
import Input from "components/Input/Input";

const LoginForm = () => {
  return (
    <Panel>
      <form>
        <div>
          <label>Username:</label>
          <Input/>
        </div>
        <div>
          <label>Password:</label>
          <Input type="password"/>
        </div>
        <div>
          <input type="checkbox"/>
          <label>Remember me</label>
        </div>
      </form>
    </Panel>
  );
};

export default LoginForm;
